import React, { useEffect, useState } from "react";
import Option from "../Options/Option";

const QuizQue = ({ que }) => {
  const { question, options,id } = que;
  return (
    <div className="grid grid-cols-2">
      <h2 className="text-center text-xl font-medium my-3">Que: {question}</h2>
      <div className="grid grid-cols-2">
        {options.map((option) => (
          <Option key={id} option={option}></Option>
        ))}
      </div>
    </div>
  );
};

export default QuizQue;
